CREATE TABLE [REP_USERS](
	[USER_ID] [bigint] IDENTITY(1,1) NOT NULL,
	[FIO] [nvarchar](500) NOT NULL,
	[LOGIN] [nvarchar](200) NOT NULL,
	[PASSWORD] [nvarchar](200) NOT NULL,
	[EMAIL] [nvarchar](500) NULL,
	[PHONE] [nvarchar](100) NULL,
	[SOL] [smallint] NULL,
